import Reactotron from 'reactotron-react-js';


class ShiftDetails extends Component {

    listData = (props) => {
        props.map((item) => {
            return( 
                <div>
                    <li>
                        number: {item.number}
                        startTime: {item.startTime}
                        endTime: {item.endTime}
                        temperature: {item.temperature}
                        wind Speed: {item.windSpeed}
                        <img src={item.icon}></img>
                        detailedForecast: {item.detailedForecast}
                    </li>
                </div>
            )
        })
    }
    render(){
        Reactotron.log('this.props', this.props)
        return (
        <div>
            {this.listData()}
        </div>
        )
    }
}

